import React from "react";
import "./style.css";
import WavySvg from "../Waves";

function Board() {
  return (
    <div className="container board">
        <div className="row">
            <div class="card">
              <img src="/images/board-1.png" class="card-img-top" alt="..."/>
              <div class="card-body">
                <h2 class="card-title text-center mt-5">About us
                <span><WavySvg/></span>
                </h2>
                <p class="card-text pr-5 pl-5">Donec aliquet, ipsum ut lobortis facilisis, nisi ligula aliquam odio, ut vehicula odio lorem in erat. Quisque quam ipsum, commodo non condimentum a, fermentum id sapien. Pellentesque sit amet sem neque. Maecenas est enim, sollicitudin sit amet nisi vel, mattis efficitur sapien. Nulla lobortis dui in aliquam placerat. Maecenas commodo odio nec neque imperdiet sagittis. Fusce mauris tellus, vulputate id finibus a, rutrum et justo. Vivamus at eros sed justo laoreet mattis vulputate vel magna. Sed quis pulvinar quam, et tempus purus. Fusce et nisi eget dui hendrerit iaculis. Cras volutpat augue tempor viverra tincidunt. Maecenas interdum scelerisque enim. Aenean interdum leo ac lectus gravida, id tincidunt sem finibus. Curabitur ac arcu blandit, tempus leo id, ultrices ante. </p>
              </div>
          </div>
        </div>
    </div>
  );
}

export default Board;
